pragma solidity ^0.5.10;

// borrowed heavily from the gnosis safe contracts

// Libraries:
import "../libraries/SigLib.sol";
import "../libraries/SafeMath.sol";
import "../lifecycle/Killable.sol";

// Inherited contracts:
import "./ProxyTarget.sol";
import "./SignerManager.sol";

contract Multisig is ProxyTarget, SignerManager, Killable {

    using SafeMath for uint256;

    /////
    // Constants:
    /////

    // TODO: add the actual hash values once the schema is decided

    // keccak256("isValidSignature(bytes32, bytes)")
    // slightly modified from EIP1271 (just hashes instead of passing bytes data)
    bytes4 public constant VALIDATOR_MAGIC_VALUE = bytes4(0);

    // keccak256(
    //  "EIP712Domain(
    //      address verifyingContract,
    //      address verifyingContractProxyTarget,
    //      uint256 setupBlockNumber
    //      uint256 chainId,
    //  )"
    // )
    bytes32 public constant DOMAIN_SEPARATOR_TYPEHASH = bytes32(0);

    // keccak256(
    //  "MultisigTransaction(
    //      address _dst,
    //      uint256 _val,
    //      bytes data
    //  )"
    // )
    bytes32 public constant TX_TYPEHASH = bytes32(0);

    // keccak256(
    //  "MultisigMessage(bytes message)"
    // )
    bytes32 public constant MSG_TYPEHASH = bytes32(0);


    /////
    // Storage:
    /////

    uint256 public nonce;
    bytes32 public domainSeparator;
    // hashes approved by ALL required signers
    mapping (bytes32 => bool) public approvedHashes;
    // hashes signed by a single signer
    mapping (bytes32 => mapping(address => bool)) public signedHashes;


    /////
    // Events:
    /////

    event Execute(address indexed dst);
    event ApproveHash(bytes32 indexed hash);
    event SignHash(bytes32 indexed hash, address indexed src);

    /////
    // Constructor:
    /////

    /**
    * @dev Constructor. ** Not run except for the base deployment! **
    * @param _guard Address of a Guard implementation
    */
    // solhint-disable-next-line no-empty-blocks
    constructor(address _guard) public Killable(_guard) {}

    /////
    // Fallback function:
    /////

    /**
     * @dev Contract is meant to receive ETH, so we must set payable fallback.
     */
    // solhint-disable-next-line no-empty-blocks
    function () external payable {}

    /////
    // Initialization function:
    /////

    // EIP 1344 would make a chainId opcode available, so we wouldn't have to pass it in
    // https://eips.ethereum.org/EIPS/eip-1344
    function setup(
        uint256 _threshold,
        uint256 _chainId,
        address[] memory _signers,
        address payable _grave,
        address _guard
    )
        public
    {
        // Check that setup has not already run, then set the domainSeparator:
        require(domainSeparator == bytes32(0), "domain-separator-set");
        domainSeparator = getDomainSeparator(_chainId, block.number, address(this), target);

        // Initialize SignerManager:
        _setupSigners(_signers, _threshold);

        // Killable Grave implementation:
        grave = _grave;
        _setGrave(_grave);

        // AuthChekcer guard implementation:
        _setGuard(_guard);
    }


    /////
    // External functions:
    /////

    // TODO: refactor to internal.
    function execute(
        address _dst,
        uint256 _val,
        bytes calldata _data,
        bytes calldata _sigs
    )
        external
        returns (bool success)
    {
        bytes32 txDataHash = keccak256(encodeTxData(_dst, _val, _data, nonce));


        nonce++;  // Must be done before _checkSigs to prevent reentrancy!
        _checkSigs(_sigs, txDataHash);

        success = _execute(_dst, _val, gasleft(), _data);

        // TODO: revert on execution failure or emit an ExecuteFailed event?
        require(success, "tx-failed");

        emit Execute(_dst);
    }

    function signHash(bytes32 _hash)
        external
        onlySigner
    {
        _signHash(_hash, msg.sender);
    }

    function signMsg(bytes calldata _msg)
        external
        onlySigner
    {
        bytes32 msgHash = keccak256(encodeMsgData(_msg));
        _signHash(msgHash, msg.sender);
    }

    function approveMsg(bytes calldata _msg)
        external onlySelf
    {
        bytes32 msgHash = keccak256(encodeMsgData(_msg));
        _approveHash(msgHash);
    }

    function approveHash(bytes32 _hash)
        external
        onlySelf
    {
        _approveHash(_hash);
    }

    /////
    // External view functions:
    /////

    // NOTE: this function reverts in the case of an invalid signature
    function isValidSignature(
        bytes32 _dataHash,
        bytes calldata _sig
    )
        external
        view
        returns (bytes4)
    {
        if (_sig.length == 0) {
            require(approvedHashes[_dataHash], "hash-not-approved");
        } else {
            _checkSigs(_sig, _dataHash);
        }
        return VALIDATOR_MAGIC_VALUE;
    }

    function isSignedHash(
        bytes32 _hash,
        address _src
    )
        public
        view
        returns (bool)
    {
        return _src == msg.sender || signedHashes[_hash][_src];
    }

    function encodeMsgData(bytes memory _msg)
        public
        view
        returns (bytes memory)
    {
        bytes32 msgDataHash = keccak256(
            abi.encode(MSG_TYPEHASH, keccak256(_msg))
        );

        return SigLib.encodeEip712Data(domainSeparator, msgDataHash);
    }

    function encodeTxData(
        address _dst,
        uint _val,
        bytes memory _data,
        uint _nonce
    )
        public
        view
        returns (bytes memory)
    {
        bytes32 txDataHash = keccak256(
            abi.encode(TX_TYPEHASH, _dst, _val, keccak256(_data), _nonce)
        );
        return SigLib.encodeEip712Data(domainSeparator, txDataHash);
    }

    function getDomainSeparator(
        uint _chainId,
        uint _setupBlock,
        address _verifierAddr,
        address _verifierTarget
    )
        public
        view
        returns (bytes32)
    {
        bytes32 verifierCodehash;
        // TODO: explanation comment here.
        assembly { verifierCodehash := extcodehash(_verifierAddr) }
        return keccak256(abi.encode(
            DOMAIN_SEPARATOR_TYPEHASH,
            _verifierAddr,
            _verifierTarget,
            verifierCodehash,
            _setupBlock,
            _chainId
        ));
    }

    /////
    // Internal functons:
    /////

    function _checkSigs(
        bytes memory _sigs,
        bytes32 _hash
    )
        internal
        view
    {
        uint256 _threshold = threshold;
        require(_sigs.length >= _threshold.mul(65), "not-enough-sigs");
        address lastSigner = address(0);
        address signer;
        for (uint256 i = 0; i < _threshold; i++) {
            uint8 v = SigLib.parseSigV(_sigs, i);

            // if v == 0, it's a contract signature
            if (v == 0) {
                signer = SigLib.recoverContractSig(_sigs, _hash, i, _threshold);

            // if v == 1, it's a signed hash
            } else if (v == 1) {
                signer = SigLib.recoverSignedHashSig(_sigs, i);
                require(isSignedHash(_hash, signer), "invalid-signed-hash-sig");
                // we could save gas by deleting the hash at this point, but
                // function would no longer be view

            // if v > 1, it's an EOA sig
            } else {
                signer = SigLib.recoverEoaSig(_sigs, _hash, i);
            }

            require(signer > lastSigner && isValidSigner(signer), "invalid-sig");
            lastSigner = signer;
        }
    }

    function _signHash(bytes32 _hash, address _src)
        internal
    {
        signedHashes[_hash][_src] = true;
        emit SignHash(_hash, _src);
    }

    function _approveHash(bytes32 _hash)
        internal
    {
        approvedHashes[_hash] = true;
        emit ApproveHash(_hash);
    }

    function _execute(
        address _dst,
        uint _val,
        uint _gas,
        bytes memory _data
    )
        internal
        returns (bool success)
    {
        // solhint-disable-next-line no-inline-assembly
        assembly {
            // call(gas, dst, value, argsOffset, argsLen, retOffset, retLen)
            // NOTE: mload(foo), for `foo` of bytes type, will return the first 32B which is 
            // encoded as the length of the array (in bytes).
            success := call(
                _gas,               // Gas amount to pass to TX
                _dst,               // Destination contract address
                _val,               // TX value (in wei)
                add(_data, 0x20),   // Offset in `_data` to start of input area
                mload(_data),       // Length of input in bytes.
                0,                  // No memory designated for outputs.
                0                   // See above.
            )
        }
    }

}
